import React from 'react';
import { useSelector } from 'react-redux';
import { Link, Redirect } from 'react-router-dom';

function Account() {
  const { status, username, email, lastName } = useSelector(
    ({ registration }) => registration.currentUser,
  );

  console.log(status);
  if (status === 'authenticated') return <Redirect to="/" />;

  return (
    <div className="container">
      <div style={{ display: 'flex' }}>
        <p style={{ marginRight: '30px' }}> Личный кабинет </p>
        <Link to="edit">Edit</Link>
      </div>
      <p className="border"> {username} </p>
      <p className="border"> {lastName} </p>
      <p className="border"> {email} </p>
    </div>
  );
}

export default Account;
